LL st1 = 50626;
LL st3 = 6724;
LL st0 = 82;
LL st2 = 16;

LL s4[nmax + 2];
LL s2[nmax + 2];
LL f[nmax + 2];
bool used[15];

LL sqrt4(LL a) {
	LL l = 0;
	LL r = 1001;
	while (l < r - 1) {
		LL mid = (l + r) / 2;
		if (mid * mid * mid * mid < a)
			l = mid;
		else
			r = mid;
	}
	return r;
}

LL sqrt2(LL a) {
	LL l = 0;
	LL r = 1001 * 1001;
	while (l < r - 1) {
		LL mid = (l + r) / 2;
		if (mid * mid <= a)
			l = mid;
		else
			r = mid;
	}
	return l;
}

int solve(LL a) {
	if (a <= nmax) {
		if (a >= st1)
			return 1;
		if (a >= st3)
			return 3;
		if (a >= st0)
			return 0;
		if (a >= st2)
			return 2;
		return T[a];
	}
	MEM(used, false);
	LL l = sqrt4(a);
	LL r = sqrt2(a);
	if (r >= st1)
		used[1] = true;
	if (r >= st3 && l < st1)
		used[3] = true;
	if (r >= st0 && l < st3)
		used[0] = true;
	if (r >= st2 && l < st0)
		used[2] = true;
	for (LL i = l; i < st2 && i <=r; ++i)
		used[T[i]] = true;
	int k = 0;
	while (used[k]) ++k;
	return k;
}

int main()
{
#ifdef _DEBUG
	freopen("input.txt", "r", stdin);
	freopen("output.txt", "w", stdout);
#else
	

#endif
	int n;
	cin >> n;
	LL a;
	int ans = 0;
	for (;n > 0; --n) {
		cin >> a;
		int pans = solve(a);
		ans ^= pans;
	}
	

	if (ans == 0)
		cout  << "Rublo" << endl;
	else 
		cout << "Furlo" << endl;
	
	return 0;
}
